import React from 'react'
import { useSelector } from 'react-redux'

function Dashboard() {
    const {user} = useSelector(state=>state.auth);


  return (
    <div className="dash">
        <div className="hide dash-error">

        </div>
        <div className="dash-head">
            Dashboard
        </div>
        <div className="dash-desc">
            Welcome {user.name}
        </div>
    </div>
  )
}

export default Dashboard
